Demo: https://youtu.be/FLyYyrGz1Xg CLEO Redux provides an interface for manipulating custom text directly in JavaScript code. There is a static variable, named FxtStore with the following interface: declare interface FxtStore { /** * Inserts new text content in the script's fxt storage overwriting the previous content and shadowing static fxt with the same key * @param key GXT key that can be used in text commands (7 characters max) * @param value text content */ insert(key: string, value: string): void; /** * Removes the text content associated with the key in the local fxt storage * @param key GXT key */ delete(key: string): void;
} Using FxtStore you can create unique keys and values in the script and put it in local FXT storage. Each script owns a private storage and keys from one script will not conflict with other scripts. Also keys defined in the FxtStore will shadow the same keys defined in static FXT files. Consider the example: custom.fxt: MY_KEY Text from FXT file custom.js: Text.PrintHelp('MY_KEY') // this displays "Text from FXT file"
FxtStore.insert('MY_KEY', 'Text from script');
Text.PrintHelp('MY_KEY') // this displays "Text from script"
FxtStore.delete('MY_KEY')
Text.PrintHelp('MY_KEY') // this displays "Text from FXT file" again A private FXT storage is not supported in San Andreas: The Definitive Edition. Each script there modifies the global FXT storage. This behavior may change in the future. Custom text can be constructed dynamically, e.g.: while(true) { wait(0); FxtStore.insert('TIME', 'Timestamp: ' + Date.now()); Text.PrintHelp('TIME') // this displays "Timestamp: " and the updated timestamp value
}
